import Head from 'next/head'
import Layout from '../components/layout';
import { siteTitle } from '../components/head-metadata';

const Home = () => (
    <Layout home>
        <Head>
          <title>{siteTitle}</title>
        </Head>
        <section className={utilStyles.headingMd}>
            <p>melanholic</p>
            <p>
                a game about trying to AGGGHHHHHHHH!!! 
            </p>
        </section>
    </Layout>  
);

export default Home;
